Là 1 trong những dự án bệnh viện thuộc hàng khủng nhất trong nội thành Hà Nội.
Dự án có tổng mức đầu tư 18.000 tỷ đồng
Đã hoàn thiện pháp lý cũng như xây thô chính của bệnh viện với diện tích 2562m2 x 9 Tầng nổi 1 hầm 1 tum
Giá chuyển nhượng đã bao gồm: 
 Các khoản thuế/phí mà Chủ đầu tư phải đóng đến thời điểm chuyển nhượng (không bao gồm tiền thuế sử dụng đất); 
Các khoản nợ mà Chủ đầu tư đã trình; 
 Hoàn trả toàn bộ hồ sơ gốc của Công ty và dự án; 
• Giá chuyển nhượng KHÔNG bao gồm:
 Hồ sơ pháp lý khác với hồ sơ hiện trạng mà Chủ đầu tư đã nêu trước khi ký kết hợp đồng; 
 Các khoản thuế/phí khác sau khi Nhà đầu tư mua cổ phần đợt 1
Dự án là nhà nước cho thuê đất trả tiền thuê đất hằng năm.Thời gian 40 năm.Và gia hạn thêm nếu hết thời hạn
Tiền thuê đất là 1 $/m2/ năm.Và điều chỉnh sau mỗi năm, 5 một lần.Nhưng không quá 15% so với lần trước đó.
